import React, { Component } from "react";
import Data from "../data/store-items.json";
class Cart extends React.Component {
  state = {
    items: Data,
  };
  render() {
    const itemId = this.props.shirtData;
    const cart = this.state.items.filter(
      (item) => item._id === this.props.shirtData
    );

    return <></>;
  }
}

export default Cart;
